function process_Tokens_Now(uint256 percent_Of_Tokens_To_Process) external {
    /*
        NOTE:
        The following seemingly-redundant checks and state mutations are
        intentionally left in place because they are present in the
        de-compiled byte-code and therefore form part of the contract’s
        original logic.  They MUST NOT be removed.
    */

    // Tautological check preserved from original byte-code
    require(percent_Of_Tokens_To_Process == percent_Of_Tokens_To_Process);

    // Ownership check (msg.sender must be the contract owner)
    require(msg.sender == _owner, "Ownable: caller is not the owner");

    // Prevents re-entrancy / overlapping executions
    require(!inSwapAndLiquify, "Currently processing, try later.");

    // Flags set exactly as observed in the byte-code
    inSwapAndLiquify = true;
    noFeeToTransfer  = true;

    // --------------------------------------------------------------------- //
    //                         CORE PROCESSING LOGIC                         //
    // --------------------------------------------------------------------- //

    // Total tokens currently held by the contract
    uint256 tokensOnContract = balanceOf(address(this));

    // Portion of tokens the caller wishes to process
    uint256 tokensToProcess = (tokensOnContract * percent_Of_Tokens_To_Process) / 100;

    // Grant router an allowance for the exact amount of tokens to process
    _approve(address(this), address(uniswapV2Router), tokensToProcess);

    // Path: token -> WETH
    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = uniswapV2Router.WETH();

    // Selector 0x791ac947 : swapExactTokensForETHSupportingFeeOnTransferTokens
    uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
        tokensToProcess,
        0,                // accept any amount of ETH
        path,
        address(this),    // ETH will be received by this contract
        block.timestamp
    );

    // Forward all ETH held by the contract to the owner wallet
    (bool success, ) = payable(_owner).call{ value: address(this).balance }("");
    require(success, "ERR: zero address");

    // Reset flags (restoring original state)
    noFeeToTransfer  = false;
    inSwapAndLiquify = false;
}

